import Header from './src/components/Header'

export default class App extends React.Component {
  render() {
    return (
    <View>
      <Header />
      <View style={styles.content}/>
      <Routes />
      {/* <BottomTabBar style={styles.bottomTab} /> */}
    </View>
    );
  }
}

const styles = StyleSheet.create({
  content: {
    height: '100%'
  },
  bottomTab: {
    bottom: 0
  }
})
